import React from 'react';

const Categories = () => {
  return (
    <div className="bg-white dark:bg-gray-800">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 py-4">
        <div className="flex space-x-4 overflow-x-auto">
          <CategoryButton name="All" />
          <CategoryButton name="Water" />
          <CategoryButton name="Soda" />
          <CategoryButton name="Energy" />
          <CategoryButton name="Sports" />
          <CategoryButton name="Premium" />
        </div>
      </div>
    </div>
  );
};

const CategoryButton = ({ name }) => {
  return (
    <button className="px-4 py-2 text-sm font-medium text-gray-700 hover:text-lexa-600 dark:text-gray-300 dark:hover:text-lexa-400">
      {name}
    </button>
  );
};

export default Categories;
